css:
.git-menu.dialog.git-log .logs {
  height: 36em;
  resize: none;
  color: #d7d8e0;
}
.git-menu.dialog.git-log .format-info {
  margin-left: 0.5em;
  color: rgba(158, 161, 179, 0.6);
  line-height: 12px;
}
.git-menu.dialog.git-log .format-info:focus,
.git-menu.dialog.git-log .format-info:hover {
  color: #d7d8e0;
}
.git-menu.dialog.git-log .format-info .icon::before {
  margin-right: 0;
  font-size: 12px;
}
